RecipeInstructions:
c("Saute carrots, onions, celery in corn oil, garlic, salt and pepper until  tender.", "Add chicken broth and bring to boil.", "Add tomatoes, Rotel, taco seasoning, and chicken.", "Cut Tortillas into small pieces and add to broth mixture.", "Let boil for 45 minutes or until tortillas are thoroughly incorporated into soup stirring occasionally to keep from sticking.", "Reduce heat and add 8 oz. cheese. Simmer for additional 10 minutes.", "Add milk and simmer for additional 10 minutes.", "If thicker soup is desired, add more diced tortillas and let incorporate into soup.", 
"Garnish with shredded cheese and broken tortilla chips.", "Substitutions: 1 cup Masa Harina (Masa Flour) for 1 10 ct. package of corn tortillas.", "Mix masa with 1 cup cold water, then add masa flour mix into soup.  If thicker soup is  desired, add more masa/water mix.", "If you don't want  to use the seasoning packet, substitute 1/2 teaspoons cumin + 1 tsp, chili powder.", "You can also use grilled chicken fajita meat for poached diced chicken.", "NOTE: If you use FLOUR tortillas, as some people have, you WILL end up with a \"TORTILLA MESS\", this recipe is for CORN tortillas. Don't go blaming me and giving me a bad review because you used the wrong stuff."
)

c("Remove lamb from refrigerator 1 hour before roasting.", "Preheat oven to 400Â°F/200Â°C/Gas 6.", "Make small slits just large enough for garlic slivers evenly in the  leg of lamb, and insert the garlic  slivers.", "Rub all over with lemon juice, then pat the rosemary and black pepper evenly over the  surface. Sprinkle with salt to taste. If you're using fresh rosemary, just insert the sprigs with the garlic slivers into the cuts you made.", "Place lamb, fat side up on a rack in an uncovered pan.", 
"Roast  30 minutes to a pound or  until the internal temperature reaches 175-180Â°F, for meat well done. If you prefer  slightly rare lamb, roast until 160-165Â°F.", "When done, remove from oven, cover the roast in foil and allow it to rest for 20 minutes before carving.", "If you also want delicious rich gravy, place a 1 1/2 cups of lamb or beef stock in the bottom of the pan before you put the lamb in the oven, making sure that the rack sits above the liquid and the meat doesn't touch it. You can also add a sprig or two of rosemary to it and if you want baste the lamb a couple of times while it's roasting. Just before serving bring the liquid to a simmer on the stove top, making sure you whisk it well and scrape all the bits from the sides and the bottom of the pan. If you want more gravy you can add some extra stock or some of the water you have cooked your vegetables inches Mix 1tbsp of cornflour with 2tbsp of water and whisk it into the stock. Simmer until thickened and you have a wonderful gravy."
)

c("In medium bowl mix together flour, rolled oats, baking powder, baking soda, salt and nutmeg.", "In large bowl, with electric mixer, cream together butter and sugar until light and fluffy.", "Add eggs and vanilla, beating well.", "Add dry ingredients alternately with bananas and buttermilk, mixing lightly after each addition.", "Pour batter into greased 13 x 9 inch (32 x 23 cm) cake pan.", "Bake at 350 F ( 180 C) for 35 - 40 minutes or until toothpick inserted in centre comes out clean.", "Cool completely on cake rack.", 
"Ice with Caramel Fudge Frosting.", "Frosting: 1/3 cup butter 1 cup lightly packed brown sugar 1/4 cup milk, 2% 2 cups sifted icing suga r Melt butter in saucepan.", "Stir in brown sugar.", "Heat to boiling, stirring constantly.", "Boil and stir over low heat 2 minutes.", "Stir in milk.", "Heat to boiling.", "Remove from heat. Gradually stir in icing sugar.", "Spread on cooled cake. Yield: 24 servings Garnish plate with a sliced strawberry and banana slices that have been dipped in orange or lemon juice."
)

c("Heat oven to 350'F Grease 13x9-inch pan.", "In large bowl, combine all brownie ingredients. Beat 50 strokes by hand.", "Spread batter in greased pan. Bake at 350'F. for 26 to 33 minutes or until set. DO NOT OVERBAKE. Cool completely.", "In small bowl, beat cream cheese and powdered sugar at medium speed until smooth.", "Add melted chocolate chips and 2 to 3 tablespoons Amaretto; beat until well blended.", "Spread filling mixture over top of cooled brownies.", "Refrigerate at least 1 hour or until firm.", 
"In small saucepan over low heat, melt l/2 cup chocolate chips and whipping cream, stirring constantly until smooth.", "Carefully spread evenly over chilled filling.", "Sprinkle with sliced almonds; garnish with candied cherries.", "Refrigerate at least 1 hour or until set; cut into bars.", "Store in refrigerator.", "TIPS: * if using almond extract instead of Amaretto, increase water in brownies to 1/2 cup; use almond extract and 2 tablespoons milk in filling.", "** To toast almonds, spread on cookie sheet. Bake at 350'F. for 5 to 10 minutes or until light golden brown, stirring occasionally. Or, spread in thin layer in microwave-safe pie pan. Microwave on HIGH for 3 to 4 minutes or until light golden brown, stirring frequently."
)

c("Preheat oven to 400Â°F Butter 13x9x2 inch glass baking dish.", "Combine first 5 ingredients in large bowl.", "Whisk milk, oil and eggs in medium bowl to blend.", "Add milk mixture to dry ingredients and stir just until blended.", "Transfer batter to prepared dish. Bake until tester inserted into center comes out clean, about 25 minutes.", "Cool. (Can be prepared 1 day ahead. Cover & let stand at room temperature).", "Preheat oven to 375Â°F.", "Cut enough corn bread into 1/2 inch cubes to measure 12  cups (reserve remaining bread for another use). Transfer to baking sheet. Bake until bread cubes are dry but not hard, about 15 minutes.", 
"Transfer to large bowl, maintain oven temperature. Butter 13x9x2 inch glass baking dish.", "Cook Chorizo in heavy large skillet over medium-high heat until brown, crumbling with back of spoon, about 10 minutes.", "Reduce heat to medium-low. Add onion, red peppers and chili; saute until tender, about 15 minutes.", "Stir Chorizo mixture, cilantro and oregano into bread. Mix in enough broth to moisten. Spoon into prepared dish.  Cover with battered foil. (can be made 1 day ahead. Cover; chill).", "Bake until heated through, about 45 minutes to 1 hour."
)

c("To prepare the Brie, discard the rind and cut the cheese in small pieces.", "Slice the onion very thinly and quarter the slices. Separate the onion pieces.", "Cut the salmon into small pieces.", "Prepare the dough and preheat the oven as directed in the basic recipe. Shape the pizza dough.", "Divide the dough and roll into small pies, about 3 to 4 inches  in diameter. Prick dough all over with the tines of a fork, then brush with  olive oil.", "Transfer the pie to the preheated baking surface and bake until the crust just begins to brown, about 6 minutes.", 
"Remove from the oven and cover with the cheese, leaving a 1/2 inch border around the edges.", "Arrange the salmon and onion on top and drizzle evenly with olive oil.", "Return to the oven and bake  until the crust is golden brown and puffy, the cheese begins to melt and the salmon is heated through, about 4 minutes.", "Remove from the oven to a cutting tray or board and lightly brush the crust with olive oil.", "Garnish with the dill.", "Slice and serve immediately.", "Recipe found on the Chatelaine recipe forum site.   - - - - - - - - - - - - - - - - - -"
)

c("Spray a la  rge skillet with cooking spray; place over medium-high heat until hot.  Add chicken; saute 4 minutes.", "Drain well.", "Stir in spaghetti sauce, water, hot  pepper sauce, vinegar and garlic salt. In a bowl, combine ricotta cheese and egg  substitute. Set aside. Spray a 9\" x 13\" baking pan with spray.", "Spread 1 cup of  the sauce over the bottom of the pan.", "Arrange four pieces of lasagna (3  lengthwise, 1 widthwise) over the sauce. Cover  with 1 1/2 cups of the sauce.  Spread half of the ricotta mixture on top.", 
"Arrange another four pieces of  lasagna over ricotta and top with another 1 1/2 cups of sauce. Spread the  remaining ricotta mixture over the top.", "Arrange final four pieces of lasagna  over ricotta mixture; cover with remaining sauce.  Preheat oven to 350 degrees F.", "cover lasagna with foil and bake for 1 hour and  10 minutes.", "Uncover lasagna, sprinkle blue cheese or mozzarella cheese over the  top, bake an additional 5 minute uncovered.", "let stand 15 minutes covered, before  serving."
)

c("Prepare greens, store in a sealed airtight plastic bag in the refrigerator until ready to serve. Arrange greens in individual salad bowls or on individual salad plates, dividing evenly.", "Top each with sliced green onions and tomato wedges or slices.", "Garnish each with crumbled blue or Roquefort cheese and/or crisp croutons, if desired.", "Pass Creamy Tomato Dressing.", "CREAMY TOMATO DRESSING Combine the first 9 to 11 ingredients together in a blender container.", "Cover and blend at medium speed for 30 seconds; uncover and with the motor at low speed, gradually add oil, blending until mixture is smooth and completely mixed.", 
"Season with salt and pepper to taste. Cover and increase motor speed to high; beat for 30 seconds.", "Store, tightly sealed, in an airtight glass container or jar in the refrigerator for up to two weeks.", "NOTE: May use about 1/4 to 1/3 cup extra virgin olive oil and 1/3 to 1/2 cup other salad oil, if desired.", "The flavor of 3/4 cup olive oil is too intense for this dressing.", "VARIATION: May add 1/2 crumbled blue or Roquefort cheese to prepared dressing, if desired. Or, may add 1/2 cup crumbled cheese to dressing mixture while beating and then stir in 1/2 cup crumbled cheese after preparation, if desired."
)

c("In a large stockpot bring the beef to a boil in 2 1/2 quart. Water with 1 tbs of salt. After 10 minutes of boiling reduce heat and simmer for 30 minutes more, then remove meat, cool and remove meat from bone & cube 1/2\".", "In a large skillet on heat the oil on medium heat. Saute the onion, beets, and carrot until they are soft. Add the potato and butter then cook for 2 minutes more.", "In the mean time bring the beef stock, water & beer to a boil in the stockpot. Add salt and pepper, vinegar, and meat.", 
"Drain the beet-carrot-onion and potato mixture and add to stockpot. Reduce heat and cook for 20 min.", "then add cabbage, tomato paste and pork butt. Cook another 30 to 45 minutes.", "Remove from heat and allow to cool to room temperature. Refrigerate overnight, re-heat and serve. A large dollop or 2 of sour cream in the soup is mandatory when served. Allow each person to stir it in themselves.", "*NOTE: You may add 1 1/2 cups of cooked white beans to this soup if you wish but if you do so soak them in vinegar then add them to the soup."
)

c("Trim fat from pork. If necessary, cut roast to fit into a 3- to 4-quart crockery cooker.", "In a small bowl combine oregano, ginger, and pepper. Rub spice mixture over entire surface of meat.", "Spray a large unheated, nonstick skillet with nonstick coating. Preheat over medium heat. Add roast and brown on all sides.", "Transfer meat to the crockery cooker; add onions.", "In a bowl combine 1 cup of the orange juice (chill remaining orange juice), the sugar, grapefruit juice, steak sauce, and soy sauce. Pour over meat in the crockery cooker.", 
"Cover and cook on low-heat setting for 8 to 10 hours or on high-heat setting for 4 to 5  hours.", "Transfer roast to a serving platter; keep warm.", "For sauce, measure pan juices into a glass measure. Skim off fat. Add additional orange juice, if necessary, to make 2-1/4 cups.", "In a medium saucepan combine cornstarch, remaining 1/4 cup orange juice, and the reserved orange peel; stir in reserved pan juices. Cook and stir until thickened and bubbly.", "Cook and stir for 2 minutes more. Pass sauce with meat. If desired, serve with noodles."
)

c("Prepare angel cake as directed on package, except pour 1/3 cup of the thawed orange juice concentrate into a 2-cup measure; add enough water to the concentrate for the mixture to equal the amount of water called for in the package directions.", "Continue with package directions, baking the batter in an ungreased 10\" tube pan according to package directions.", "Immediately invert cake (leave in pan); cool completely.", "Loosen sides of cake from pan; remove cake from pan.", "For topping, in a medium bowl gently stir together the thawed topping and yogurt. Fold in remaining orange juice concentrate.", 
"Spread topping mixture over top and sides of cake. If desired, garnish with citrus roses made from grapefruit or orange peel. Store in the refrigerator.", "Citrus Rose: Cut the peel from stem end of a Florida Orange or Grapefruit, forming a circular base (do not sever). Continue cutting a strip of peel about 3/4\" to 1\" wide in a spiral motion to opposite end of fruit, making one lon g, continuous strip and slicing thinly (do not cut into white membrane). Start coiling strip tightly, beginning at end opposite base. Coil the strip onto the base to form a rose. Garnish with mint leaves and small strips of peel, if desired."
)

c("You can add these ingredients to the mashed potato centers if desired.", "1/3 cup milk 1/4 cup butter salt and pepper a few drops hot sauce Scrub potatoes, dry, then pierce with fork several times.", "Arrange on a baking sheet and bake in 375 degree oven for about 1 hour or until tender.", "Let stand until cool enough to handle. Cut potatoes in half lengthwise and scoop out centers, leaving 1/8\" potato in shell.", "Cover.", "Chill shells up to 2 days until ready to use for the skins.", "If desired, add the 1/3 cup milk, 1/4 cup butter, salt and pepper to use potato centers as mashed potatoes.", 
"When ready to prepare skins, melt the 1/3 cup butter.", "Brush shells with the butter, inside and out. Place, cut side up, on baking sheet. Bake in a 500 degree oven for 20 minutes or until brown and crisp.", "Distribute some bacon, onion, and cheese in each shell.", "Bake just until cheese melts.", "Serve hot. If the potatoes are large, you may want to cut in half crosswise before serving.", "You may want to double this recipe if you are serving several people, especially if they are hungry!  Serves: 6."
)

c("Heat oven to 375 degrees. Line a cookie sheet with foil.", "Beat eggs, sugar and coffee granules in a med. bowl with electric mixer until coffee granules dissolve and mixture is thick.", "Fold in 1/2 cup flour, nuts and remaining 1/2 cup flour until well blended.", "Spoon batter into a gallon size zipper-type plastic bag and snip off a corner to make a 1/2\" wide opening (or use pastry bag fitted with a plain 1/2\" round tip).", "Pipe nine 12\" long strips crosswise 1\" apart on prepared cookie sheet.", 
"Bake 6-8 min. until strips look dry and spring back when lightly touched. Do not brown.", "Remove from oven. (Increase temperature to 400 degrees).", "Let cool on sheet  1-2 min.", "While still warm, peel 1 strip at a time from foil, place on a  cutting board and with a serrated knife, cut diagonally into 20 slices.", "Remove foil from cookie sheet. Scatter slices over ungreased cookie sheet.", "Bake 10-12 min., turning slices once with a metal pancake turner, until dry and toasted.", "Slide cookies onto countertop to cool completely. Store loosely covered in a cool, dry place up to 1 month."
)
